import React from 'react';

import '../App.css';

import Sky from 'react-sky';
import im1 from '../Ressources/im1.png'
import im2 from '../Ressources/im2.png'
import im3 from '../Ressources/im3.png'
import im4 from '../Ressources/im4.png'
import im5 from '../Ressources/im5.png'
import im6 from '../Ressources/im6.png'
import im7 from '../Ressources/im7.png'
import im8 from '../Ressources/im8.png'

function Field() {
    return (
        <div className="center">
                        <Sky
                            images={{
                                0: im1,
                                1: im2,
                                2: im3,
                                3: im4,
                                4: im5,
                                5: im6,
                                6: im7,
                                7: im8, 
                            }}
                            how={130} 
                            time={40} 
                            size={'25px'} 
                            background={'palettedvioletred'}
                        />
                        <span>
                        <h5 className="header col s12 light">Artificial Intelligence</h5>
                        </span>

                        <span>
                        <h5 className="header col s12 light">Web Development</h5>
                        </span>

                        <span>
                        <h5 className="header col s12 light">Computer Vision</h5>
                        </span>
                    </div>
        );
}

export default Field;
